
SELECT COUNT(*) as agg_0 FROM "member" LEFT OUTER JOIN "payment" ON "member"."member_no" = "payment"."member_no" LEFT OUTER JOIN "region" ON "member"."region_no" = "region"."region_no" LEFT OUTER JOIN "provider" ON "region"."region_no" = "provider"."region_no" LEFT OUTER JOIN "corporation" ON "region"."region_no" = "corporation"."region_no"  WHERE "region"."country" IN ('Sw', 'Ke', 'Ca', 'Ja') AND "payment"."member_no" IS NOT NULL AND "provider"."region_no" IS NOT NULL AND "corporation"."region_no" IS NOT NULL;